import {BrouserRouter, Routes ,Route} from "react-router-dom"; 
import './App.css';
import Layout from './components/Layout';

function App() {
  return (
    <div className="App">
     <BrouserRouter>
       <Routes>
        <Route path='/' elemnt={<Layout/>} />
       </Routes>
     </BrouserRouter>
    </div>
  );
}

export default App;
